import React from 'react';
import { NavLink } from 'react-router-dom';
const Naviger = () => {
    return (
        <div>
            <button type="button" class="btn btn-primary">  <br /> Accueil</button>  <NavLink to='/'></NavLink>
            <NavLink to='/create'><button type="button" class="btn btn-primary">Create</button></NavLink><br />
            <NavLink to='/update'>Update</NavLink><br />
            <NavLink to='/delete'>Delete</NavLink>


        </div>
    );
};

export default Naviger;
